function randomId(){const uint32=window.crypto.getRandomValues(new Uint32Array(1))[0];return Date.now()+uint32.toString(16)}function wafInitVgcButton(merchant_key,button_type,title,description,callback_url,return_url,currency_code,currency_name,shape,color,element_id,price_label){let element=document.getElementById(element_id);let email=null;let first_name=null;let last_name=null;let public_key=null;let vgcDetails={};vgcDetails.get=(url=>{return new Promise(function(resolve,reject){let req=new XMLHttpRequest;req.open("GET",url);req.onload=function(){if(req.status===200){resolve(req.response)}else{reject(Error("promise error with "+req.status))}};req.onerror=function(err){reject(Error("Network Error: "+err))};req.send()})});vgcDetails.getJSON=async function(url){let data={};let string=null;try{string=await vgcDetails.get(url)}catch(e){element.innerHTML="Error: "+e}try{data=JSON.parse(string);success=true}catch(e){element.innerHTML="Error: "+e}return data};async function vgc_detail_init(){let detail=null;try{detail=await vgcDetails.getJSON("https://verygoodcollection.com/api/user-details/"+merchant_key);if(detail.status==="success"){email=detail.data.email;first_name=detail.data.first_name;last_name=detail.data.last_name;public_key=detail.data.public_key;if(email&&first_name&&last_name&&public_key){let HTML="<style>\n"+"   .wafVgcButtonContainer{width: 300px;max-width: 100%;margin: auto;}\n"+"   .waf_vgc_js_form_btn{width: 100%;border: none;font-size: 1em;line-height: 1;padding: 0.8em 0.5em;font-weight: 600;border-radius: 0.5em; cursor: pointer}\n"+"   .waf_vgc_js_form_btn.pill,{border-radius: 1.5em;}\n"+"   .waf_vgc_js_form_btn:hover {filter: brightness(0.95);}\n"+"   .waf_powered_by_vgc{display: table;margin: 6px auto 0;}\n"+"   .waf_powered_by_vgc .waf_powered_by_text{display: table-cell;vertical-align: bottom;line-height: 1;padding-right: 5px;}\n"+"   .waf_powered_by_vgc img{display: table-cell;max-height: 30px;width: auto;}\n"+"    .waf_select_list{ width: 100%;padding: 0.4em 0.5em;border-radius: 0.5em; margin-bottom: 20px;}\n"+"    .waf_variable_label{font-weight: 600;display: block;margin-bottom: 0.4rem;}\n"+"     .waf_variable_price{margin-bottom: 17px;margin-right: 10px;width: calc(100% - 50px);}\n"+"</style>";if(button_type==="variable_price"){HTML+='<label class="waf_variable_label">'+price_label+"</label>"+'<input name="waf_variable_price" type="number" class="waf_variable_price" required>'+'<span name="waf_variable_currency" class="waf_variable_currency">'+currency_name+"</span>"}HTML+='<form class="waf_vgc_js_form" method="POST" action="https://verygoodcollection.com/ext_transfer" >\n'+'<input type="hidden" class="waf_vgc_merchant_key" name="merchant_key" value="'+merchant_key+'" />\n'+'<input type="hidden" class="waf_vgc_public_key" name="public_key" value="'+public_key+'" />\n'+'<input type="hidden" class="waf_vgc_callback_url" name="callback_url" value="'+callback_url+'" />\n'+'<input type="hidden" class="waf_vgc_return_url" name="return_url" value="'+return_url+'" />\n'+'<input type="hidden" class="waf_vgc_tx_ref" name="tx_ref" value="'+randomId()+'" />\n'+'<input type="hidden" class="waf_vgc_amount" name="amount" value="'+price_label+'" />\n'+'<input type="hidden" class="waf_vgc_email" name="email" value="'+email+'" />\n'+'<input type="hidden" class="waf_vgc_first_name" name="first_name" value="'+first_name+'" />\n'+'<input type="hidden" class="waf_vgc_last_name" name="last_name" value="'+last_name+'" />\n'+'<input type="hidden" class="waf_vgc_title" name="title" value="'+title+'" />\n'+'<input type="hidden" class="waf_vgc_description" name="description" value="'+description+'" />\n'+'<input type="hidden" class="waf_vgc_quantity" name="quantity" value="1" />\n'+'<input type="hidden" class="waf_vgc_currency" name="currency" value="'+currency_code+'" />\n'+'<button class="waf_vgc_js_form_btn" type="submit">Checkout</button>\n'+'<div class="waf_powered_by_vgc"><span class="waf_powered_by_text">Powered by </span><img src="data:image/jpeg;base64," alt="Very Good Collection logo"></div>\n'+"</form>";element.innerHTML=HTML;switch(color){case"Blue":document.querySelector("#"+element_id+" .waf_vgc_js_form_btn").style.cssText="background-color: #0070ba; color: #ffffff;";break;case"Silver":document.querySelector("#"+element_id+" .waf_vgc_js_form_btn").style.cssText="background-color: #eeeeee;";break;case"White":document.querySelector("#"+element_id+" .waf_vgc_js_form_btn").style.cssText="background-color: #ffffff; border: #555555 solid 1px;";break;case"Black":document.querySelector("#"+element_id+" .waf_vgc_js_form_btn").style.cssText="background-color: #2c2e2f; color: #ffffff;";break;default:document.querySelector("#"+element_id+" .waf_vgc_js_form_btn").style.cssText="background-color: #ffc43a;"}if(shape==="Pill"){document.querySelector("#"+element_id+" .waf_vgc_js_form_btn").classList.add("pill")}let variable_price_element=document.querySelector("#"+element_id+" .waf_variable_price");if(variable_price_element){document.querySelector("#"+element_id+" .waf_variable_price").addEventListener("change",function(event){document.querySelector("#"+element_id+" .waf_vgc_amount").value=event.target.value})}}}}catch(e){element.innerHTML="Error: "+e}}vgc_detail_init()}